import React from 'react';

import { Container } from './styles';

const InputDropdown: React.FC = () => {
  return (
    <Container>
      <input type="text" list="cities" />
      <datalist id="cities">
        <option value="boston">Boston</option>
        <option value="new york">New</option>
      </datalist>
    </Container>
  );
};

export default InputDropdown;
